import "./App.css";
import Navbar from "./component/Navbar";
import Home from "./component/Home";
import { Switch, Route } from "react-router-dom";
function App() {
  return (
    <>
      <Switch>
        <Navbar />
        <Home />
      </Switch>
    </>
  );
}

export default App;
